import React, { useEffect, useState } from "react";

const BestProperties = () => {
  const [properties, setProperties] = useState([]);

  useEffect(() => {
    fetch("https://68b826bcb715405043274639.mockapi.io/api/properties/PropertyListing")
      .then((res) => res.json())
      .then((data) => setProperties(data.slice(0, 25))) // show only 25
      .catch((err) => console.error("Error fetching data:", err));
  }, []);

  return (
    <div style={{ width: "90%", margin: "auto", padding: "40px 0" }}>
      {/* Header Section */}
      <div
        style={{
          display: "flex",
          justifyContent: "space-between",
          alignItems: "center",
          marginBottom: "15px",
        }}
      >
        <div>
          <h2 style={{ fontSize: "26px", fontWeight: "bold", color: "#0a2a66" }}>
            Best Properties Available For Sale
          </h2>
          <p style={{ color: "#555", marginTop: "6px" }}>
            Browse our top-rated properties for sale, featuring premium listings tailored to
            your needs. Find your dream home today!
          </p>
        </div>

        <button
          style={{
            padding: "10px 22px",
            border: "none",
            background: "#0a2a66",
            color: "white",
            fontWeight: "500",
            borderRadius: "25px",
            cursor: "pointer",
            transition: "all 0.3s ease",
            whiteSpace: "nowrap",
          }}
          onMouseOver={(e) => (e.target.style.background = "#003bb3")}
          onMouseOut={(e) => (e.target.style.background = "#0a2a66")}
        >
          View More Properties
        </button>
      </div>

      {/* Property Cards */}
      <div
        style={{
          display: "grid",
          gridTemplateColumns: "repeat(auto-fill, minmax(280px, 1fr))",
          gap: "25px",
          marginTop: "20px",
        }}
      >
        {properties.map((property, index) => (
          <div
            key={index}
            style={{
              background: "white",
              borderRadius: "15px",
              overflow: "hidden",
              boxShadow: "0px 4px 12px rgba(0,0,0,0.1)",
              display: "flex",
              flexDirection: "column",
            }}
          >
            {/* Image */}
            <img
              src={`https://picsum.photos/400/250?random=${index}`}
              alt={property.name}
              style={{
                width: "100%",
                height: "200px",
                objectFit: "cover",
                borderTopLeftRadius: "15px",
                borderTopRightRadius: "15px",
              }}
            />

            {/* Info Section */}
            <div style={{ padding: "15px", flex: "1" }}>
              {/* Location + Rating */}
              <div
                style={{
                  display: "flex",
                  justifyContent: "space-between",
                  alignItems: "center",
                  marginBottom: "6px",
                }}
              >
                <span style={{ fontSize: "13px", color: "#666" }}>
                  📍 {property.city}, {property.country}
                </span>
                <span style={{ color: "#f4b400", fontSize: "14px", fontWeight: "500" }}>
                  ⭐ {(Math.random() * (5 - 4) + 4).toFixed(1)}/5
                </span>
              </div>

              {/* Description */}
              <p style={{ fontSize: "14px", color: "#444", marginBottom: "12px" }}>
                Beautiful {property.name} located in {property.city}, {property.country}.
                Modern amenities and prime location.
              </p>

              {/* Footer - Button + Price */}
              <div
                style={{
                  display: "flex",
                  justifyContent: "space-between",
                  alignItems: "center",
                }}
              >
                <button
                  style={{
                    padding: "8px 16px",
                    border: "none",
                    borderRadius: "20px",
                    background: "#0a2a66",
                    color: "white",
                    cursor: "pointer",
                    transition: "background 0.3s",
                  }}
                  onMouseOver={(e) => (e.target.style.background = "#003bb3")}
                  onMouseOut={(e) => (e.target.style.background = "#0a2a66")}
                >
                  Buy Now
                </button>
                <span style={{ fontSize: "17px", fontWeight: "bold", color: "#000" }}>
                  ${property.buildingNumber * 300}
                </span>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default BestProperties;
